Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
function 攻击时四向移动(上,下,左,右)
{
   if(上!=0)
   {
      _parent.移动("上",上);
   }else if(下!=0)
   {
      _parent.移动("下",下);
   }
   if(左!=0)
   {
	  _parent.方向改变("左");
      _parent.移动("左",左);
   }else if(右!=0)
   {
	  _parent.方向改变("右");
      _parent.移动("右",右);
   }
}
gotoAndPlay(_parent.近战招式);

onClipEvent(enterFrame){

   _parent.攻击时移动(35,35);
}

//本帧是锁定敌人位置的帧，建议比位移元件早一些。已启用Z轴追踪，所以应尽可能提前于位移元件用于反应。

//你需要改的值，追踪持续帧是从挂载ef的位移元件的第二帧到预计实际到达敌人位置时的总帧数。
速度上限 = _parent.行走X速度 * 6;
速度下限 = _parent.行走X速度 * 1;
追踪持续帧 = 5;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);

if (速度X >= 0)
{
	速度X = Math.max(速度X, 速度下限);
	左速度 = 速度X;
}
else
{
	速度X = Math.min(速度X, -速度下限);
	右速度 = -速度X;
}
// 给予Z轴位移能力，启用以下代码，需谨慎给予，且应该比位移元件提前更多帧。
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度Z = 速度X * 距离Z / 距离X;
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 0.7);
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 0.7);
}

